import React from 'react';
import {Axios as axios} from "axios";

const TextKeybComponent = message => {


    async function getUsers(message) {
        let response = await fetch('http://example.com/api/users');
        if (response.ok) {
            let data = await response.json();
            console.log(data);
            return data
        } else {
            alert('error', response.status);
        }
    }

    return (
        <div>
            <button onClick={getUsers}>GET TEXT</button>
        </div>
    );
};

export default TextKeybComponent;
